wp.customize.controlConstructor["oceanwp-multi-check"]=wp.customize.Control.extend({ready:function(){"use strict";var i=this;i.container.on("change","input",function(){var c=[],e=0;jQuery.each(i.params.choices,function(n,t){i.container.find('input[value="'+n+'"]').is(":checked")&&(c[e]=n,e++)}),i.setting.set(c)})}});